import React from "react";


const Form = () => {
  //Aqui deberan implementar el form completo con sus validaciones

  return (
    <div>
      <form>
        <label>Name:</label>
        <input type="text" value="naem" />
        <label>Email:</label>
        <input type="email" />
        <button>Send</button>
      </form>
    </div>
  );
};

export default Form;
